INSERT INTO `active` VALUES ('1', '第八届“东方财富杯”全国大学生金融精英挑战赛校级选拔赛', '2022-04-01 12:29:40', '2022-04-20 12:30:05', '68', 't1.png', '1', '本届竞赛（校赛）分为三个阶段： 第一阶段：报名 报名目的：确定参赛人员，明确竞赛规模。 报名时间：2022 年 3 月 28 日-5月17 日 第二阶段：热身赛（个人赛） 竞赛时间：2022年3月28日—2022年4月22日 （熟悉赛事项目流程，该阶段成绩不计入总成绩） 第三阶段：校赛（个人赛） 竞赛时间：2022年4月25日一2022年5月20日 竞赛形式：线上比赛 比赛期间对活动有疑问的同学可加群询问（群号:887673255②群724749329，）', '0', '600', '2022-04-03 12:33:23', '2022-04-07 12:33:36', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('2', 'Thunderbolt魔术社迎新路演活动', '2022-03-03 12:38:06', '2022-03-13 12:38:23', '21', 't2.png', '1', '秋风送爽，金秋十月。为迎接各位新同学顺利结束快乐军训，开启丰富多彩的大学生活，Thunderbolt魔术社将于10月10号在东门篮球场路口举行魔术路演,你是否也想和我们在秋天中相约，一起探究魔术的奥秘。金秋魔术秀-Thunderbolt魔术社迎新路演活动，期待与你的邂逅~ 活动内容: 1社长进行社团介绍; 2在路边摆点，为大一新生们表演精彩的魔术; 进行魔术专场表演节目类型为近景，互动魔术类型; 4进行互动游戏为参与互动体验的新生准备一些魔术小礼物。', '600', '600', '2022-03-05 12:39:47', '2022-03-08 12:40:00', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('3', '校团委组织部三月份团日活动', '2022-03-01 12:40:44', '2022-03-22 12:40:52', '33', 't3.png', '2', '在庆祝中国共产党成立100周年大会上，习近平总书记以豪迈的自信、激昂的壮志，庄严宣告实现了第一个百年奋斗目标、全面建成了小康社会，郑重宣示坚持和发展新时代中国特色社会主义、向全面建成社会主义现代化强国的第二个百年奋斗目标迈进的坚定决心。2021年9月18日是全国第21个全民国防教育日,恰逢“九一八”事变爆发90周年纪念日。为学习贯彻习近平总书记“七一”重要讲话精神，弘扬爱国主义精神,推动国防教育深入普及，校团委特此举办“学习贯彻习近平总书记‘七一’重要讲话精神——全民国防，强国有我”主题团日活动。', '3000', '3000', '2022-03-03 12:42:05', '2022-03-13 12:42:15', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('4', '计算机保养和软件推荐讲座', '2022-06-08 12:44:08', '2022-05-12 12:44:26', '56', 't4.png', '3', '计算机保养和软件推荐活动分3个部分进行。 1. 第一部分 为同学讲解如何保养电脑，让电脑的运行寿命更长，运行速度更快。 2. 第二部分 为同学推荐一些好软件，如：去除电脑广告的火绒杀毒软件，卸载流氓软件的geek等。让同学们远离广告和流氓软件骚扰，更加舒适地使用和维护电脑。 3.第三部分 疑问解答，对同学们不够清楚的部分进行解答。', '2', '200', '2022-04-28 12:45:23', '2022-05-05 12:45:31', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('5', '包设初心沙画社协会“一路生花”活动', '2022-04-17 12:45:59', '2022-04-22 12:46:13', '466', '23.png', '4', '今年是疫情的第三年了，但疫情反复，形势并不乐观。疫情防控期间，我校为坚决贯彻落实党中央、市政府关于做好疫情防控的指示精神和部署要求，对全校师生进行封闭式管理。封校期间，同学们的活动空间、娱乐方式受限，不再如往常一样自由。尽管我们的脚步受到约束，但春天依旧如约而至，各种花儿争相开放，身边的美景并不缺乏。 因此，本社团特开展此次活动，意在引导同学们积极支持配合防疫工作的开展、找寻平常生活中的小美好，尽情享受工大校园里的春天。', '156', '800', '2022-04-15 12:47:04', '2022-04-17 12:47:08', '1', '线下-图书馆前坪');
INSERT INTO `active` VALUES ('6', '体育学院学习部“读原著名著”，写读后感', '2022-05-12 12:45:59', '2022-05-20 12:46:13', '160', '24.png', '2', '象棋棋蕴含着中华文化的丰富内涵，象棋，中国国内原称中国象棋。是经国家体育行政部门正式批准的体育运动项目。她在体育竞技、健身益智、绿色产业三大领域各领风骚，为象棋文化发展源源不断提供丰富多彩、生动活泼的内容。它是中国文化与文明的体现。', '0', '500', '2022-04-09 12:47:04', '2022-04-29 12:47:08', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('7', '经贸青志联“春日限定，巧手生趣”义卖活动', '2022-04-19 12:45:59', '2022-05-23 12:46:13', '262', '25.png', '2', '本次活动为经贸青志联与经贸外联部共同举办的线下活动，参与活动的人员需要完成两个任务即可在到梦空间签到成功。 任务一：在到梦空间报名参与本次活动，报名成功的同学加入本次活动群并将活动内容转发到QQ空间集赞。 任务二：在具体摆点摊位，给工作人员出示说说，添加经贸官Q即可扫码签到，工作人员根据集赞数量分配DIY区域，填写信息后领取号码牌，有序进行DIY，最终成品以义卖的形式售出。', '89', '500', '2022-04-15 12:47:04', '2022-04-16 12:47:08', '0', '线下-正门喷泉广场 ');
INSERT INTO `active` VALUES ('8', '计算机学院青志联“齐手添绿意，共同度奥运”', '2022-04-27 12:45:59', '2022-04-29 12:46:13', '899', '26.png', '1', '今天，奥林匹克已经成为全人类的一种共同的愿望、一种共同的期待，一种共同的祝愿。它随着时间的流逝而不断丰富，不断增添新的内涵，成为人类不断创新、不断增长的宝贵精神文化遗产。 同时，伴随着同学们的下半学期开学，春天也就到来了。俗话说：季节不等人，春日胜黄金。对于生活在地球上的每一个人来说春天都有着其独特的意义，作为人类的一员，保护我们的家园最大的措施就是植树造林。 因此，计算机青志联将举办此次有关奥运以及一些关于绿色植物“知识趣味竞答”的志愿活动。借此活动，了解并弘扬现代奥林匹克精神，提高在校学生文化素养，了解相关国际局势，增加对不同国家文化认识，增强当代青年团结、拼搏、坚持的良好品质，激发学生运动热情，树立良好的生命观，也为了保护生态的平衡，提高当代青年的生态保护意识。', '0', '500', '2022-04-10 12:47:04', '2022-04-14 12:47:08', '0', '线下-计通楼510');
INSERT INTO `active` VALUES ('9', '义工联合会--“疫”路有你，温暖相伴', '2022-04-08 12:45:59', '2022-04-14 12:46:13', '369', '27.png', '5', '在茫茫的宇宙中，人类就如同那沧海一粟，在灾难与疾病面前，我们同样渺小，但我们却能够团结一心，共同抵抗新冠疫情。突如其来的疫情无疑影响了我们的正常的生活节奏，但也因为这场疫情，才让我们更懂得去珍惜现在的每一天。次活动旨在了解参与者对于疫情的看法以及对疫情结束后的一些期盼，从而增强大家共同抗击疫情的决心与斗志。', '500', '500', '2022-04-09 12:47:04', '2022-04-10 12:47:08', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('10', '湖南工业大学学生会第三届“主席团面对面”活动', '2022-05-06 12:45:59', '2022-05-20 12:46:13', '1026', '28.png', '2', '随着新学期的开始，湖南工业大学第十四届学生会成立之后，各部门携手并进，各位学生会成员坦诚合作，力争在改革换届之后建立一个创新性强、时效性高的大团队。在各位成员的竭诚努力下，第十四届学生会处理了许多大小事务，也面临了许多挑战和困难。为帮助工作人员更深层次的了解改革之后的学生会如何更合理地运行，从而为学生会未来的建设建言献策、增加了解主席团成员的学习工作经验的窗口，也为了促进主席团成员更好地了解工作人员的思想状态。同时进一步学习和研读《湖南工业大学学生会研究生会）建设管理实施办法》，充分意识到学生会改革的重要性及必要性，从而更好的完成换届工作。湖南工业大学第十四届学生会特此组织此次内部交流会', '3', '3000', '2022-04-20 12:47:04', '2022-05-03 12:47:08', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('11', '电影协会“音你而来”配音大赛', '2022-04-22 12:45:59', '2022-05-06 12:46:13', '754', '29.png', '4', '为提高学生积极性，加强学生间的文化交流，开拓思路，陶冶情操，培养大学生灵活机智的思维，表达当代大学生的青春风貌和综合素质，丰富校园文化。通过比赛展演，彰显语言文化的魅力，让广阔同学感受影片的魅力和配音的乐趣，拓宽知识面，加深对当代文化的理解，提高同学们的科学文化层次。', '0', '500', '2022-04-12 12:47:04', '2022-04-20 12:47:08', '0', '线下-崇材楼');
INSERT INTO `active` VALUES ('12', '材料学院学习宣传部考研经验交流会暨优秀学生事迹报告会', '2022-04-16 12:45:59', '2022-04-18 12:46:13', '256', '30.png', '2', '1.由主持人宣布活动开始，迎接嘉宾入场就座；2.介绍嘉宾及其主要事迹并介绍此次活动性质及目的；3.由嘉宾逐个登台，通过PPT讲述大学生活、考研的经验及感想看法，激励学弟学妹；4.提问环节，观众根据分享内容自由交流，嘉宾答疑解惑；5.主持人总结，作对同学们的鼓励寄语，结束经验分享交流会，大家有序离场，带走随身携带物品；6.学习宣传部干事留下打扫卫生。活动签到（扫码签到）。', '423', '500', '2022-04-15 12:47:04', '2022-04-17 12:47:08', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('13', '城市与环境学院易班工作站“易”石二鸟', '2022-04-20 12:45:59', '2022-04-21 12:46:13', '2457', '31.png', '1', '1.参与者在活动期间收集到的旧物，回收利用并制作创新物品，然后将作品拍照； 2.参与者将自己所拍摄的照片上传至qq空间，写明创作思路并@城市与环境学院易班官Q（1457417433）； 3.参与者加入活动群在规定时间内将qq动态截图附上班级姓名上传至群相册，即可签到。', '349', '500', '2022-04-23 12:47:04', '2022-04-28 12:47:08', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('14', '科技学院班级风采展示大赛', '2022-04-18 12:45:59', '2022-04-30 12:46:13', '1251', '32.png', '2', '为进一步丰富校园文化生活，努力营造积极向上、百花齐放的班级文化氛围，丰富学生课余文化生活，加强校园班级精神文明建设，展示学生团结创新、锐意进取的精神风貌，弘扬“厚德博学，和而不同”的校训精神，特举办班级风采展示大赛。该活动由班级文化和风采展示两部分组成，其中班级文化通过PPT制作及其讲解视频呈现，风采展示通过班级特色视频呈现。', '423', '800', '2022-04-09 12:47:04', '2022-04-10 12:47:08', '1', '线上-腾讯会议');
INSERT INTO `active` VALUES ('15', '生化学院学习部第二届笔墨生画月之阅读分享大赛活动', '2022-04-20 12:45:59', '2022-04-27 12:46:13', '867', '33.png', '4', '有意向报名参加此次活动的同学，在生化学院学习部发出相关活动通知后，即可到本班学委处报名，由学委登记名单并上交给学习部。参赛人员需要在比赛之前准备好PPT（请将PPT提前发送给学习部，由学习部提前上传至电脑），且准备5-8分钟以上的演讲内容（配合PPT即可）。PPT主要内容为概括自己所要分享书籍，以及自己从书中获得的启发，获得的感想等。PPT以及演讲内容要求积极健康向上，能够给予一定的引导正确人生价值的作用。 演讲过程要求语句通顺，内容真实，中心突出，情感真挚，感染力强。从而鼓励学生在校期间多读书、读好书，提醒同学们进入大学也不忘博览群书。', '655', '900', '2022-04-20 12:47:04', '2022-04-22 12:47:08', '1', '图书馆学术报告厅');
INSERT INTO `active` VALUES ('16', '外语爱好者协会“请君为我倾耳听”配音比赛', '2022-04-16 12:45:59', '2022-04-20 12:46:13', '558', '34.png', '2', '外语配音比赛 喜欢外语？热爱配音？痴迷国外影片？为了帮助大家更好的学习外语，今特此举办了“请君为我倾耳听”英语配音竞赛活动。同时也为大家提供了一个平台，展示自己的能力，丰富课余生活。 活动内容：学生通过配音自己喜欢的电影片段或者一些经典片段来进行分享，也可以自由选择自己感兴趣的材料进行配音学习。 学习娱乐融于一体的精彩活动，不容错过！还有荣誉证书等你来拿！快快来报名参加活动吧！', '458', '800', '2022-04-14 12:47:04', '2022-04-16 12:47:08', '1', '线上-腾讯会议');
INSERT INTO `active` VALUES ('17', '理学院心理部“拥抱自然，释放压力”5.25特别活动', '2022-04-20 12:45:59', '2022-04-27 12:46:13', '1521', '35.png', '2', '在疫情期间，学校为了同学们的安全着想选择封校。由于不能出校，同学们的课后生活户外活动减少，大多数同学选择宅在寝室，导致出现了焦虑，不安等负面情绪，为了帮助同学们缓解这些负面情绪，我院心理部决定举办此次“拥抱自然，释放压力”户外运动活动。', '841', '2000', '2022-04-17 12:47:04', '2022-04-20 12:47:08', '1', '线下-五食堂田径场');
INSERT INTO `active` VALUES ('18', '加强体育锻炼，助力疫情防控', '2022-04-19 12:45:59', '2022-04-29 12:46:13', '898', '36.png', '5', '一、活动形式 （一）锻炼晒图: 活动参与者可以自己选择一项或多项自己喜欢的运动，如：篮球、羽毛球、跳绳、跑步、排球等等，在自己空余时间并选择合适场地进行锻炼并拍照。要求：照片至少两张且清晰，含有主要人物，能体现所选运动项目内容。视频尽量控制在一分钟左右，有创意的视频更佳。 （二）目标跑步： 活动参与者需下载keep或其他跑步app进行活动，活动参与者利用如Keep app内跑步记录功能制定一周跑步计划，活动参与者需在活动期限内任选三天，每天需达成至少一公里跑步目标，并利用跑步app进行数据记录并截屏，将三次跑步达成的目标截图保存。要求：截屏要包括跑步里程、路线图、时间日期。 （三 ）趣味游戏： 活动参与者可以选择一种趣味游戏邀请伙伴一起锻炼，如：扔沙包——两个人站在两侧，中间站适当的人，两侧的人其中一人手持沙包扔向中间人群，包未离开扔沙包的人手时，中间的人无论站在哪都不能动，直到沙包出手才可以躲避，考验反应能力，如果不幸被扔便代替扔沙包的人，如果未被扔到，中间的人需捡起扔向另一侧的人，其中，如果中间的人接到沙包则可以增加一条“命”。此活动形式需活动参与者自己选择一种趣味游戏并拍照或视频记录，注意：照片至少两张且清晰，含有主要人物，能体现所选运动项目内容。视频尽量控制在一分钟左右，有创意的视频更佳。 （四）歌舞比拼： 活动参与者拍摄自己唱歌或跳舞的视频并加以创新制作，视频尽量控制在一分钟左右，有创意的视频更佳。 二、活动签到方式 根据所选形式上传照片、截屏或视频到咨询群里所发布的作业中并附上自己的学院姓名学号，注：为保护个人隐私，本次线上活动签到采用作业形式，咨询群作业发布时间将会在活动结束前提前在群里告知大家，请大家留意群内信息。', '652', '1200', '2022-04-18 12:47:04', '2022-04-20 12:47:08', '1', '线上-腾讯会议');
INSERT INTO `active` VALUES ('19', '阳光运动协会“长板趣味赛”', '2022-04-21 12:45:59', '2022-04-28 12:46:13', '795', '37.png', '1', '活动咨询群：694024559 参加活动的人员从以下项目中任选三项完成即可签到 以下项目进行积分制，第一名6分，第二名4分，第三名3分，四～六名1分，根据结束时的总分进行排名。 长板趣味赛内容介绍： 1、长板老司机 比赛规则：一人站在板上，一人坐在板上，从一端滑至另一端 2、双人推手赛 比赛规则：两人同时站在板子上，对立而站，同时伸出胳膊，四掌相对，先落地算失败 3、长板绕桩赛 比赛规则：参赛者滑长板依次绕过每个桩，完成时间短者获胜 比赛要求：不能漏绕，不能撞桩 4、转圈滑行赛 比赛场地：湖南工业大学正门国旗广场 比赛规则：发令后原地转10圈，滑着板子向终点 比赛要求：滑行过程中不得双脚同时接触地面 5、夹乒乓球赛 比赛规则：两人一组，夹乒乓球进行接力 比赛要求：乒乓球每掉一次，时间+5s', '156', '500', '2022-04-19 12:47:04', '2022-04-20 12:47:08', '0', '篮球场');
INSERT INTO `active` VALUES ('20', '科技学院四月回暖，以歌祝春校园十佳歌手大赛', '2022-04-19 12:45:59', '2022-04-21 12:46:13', '632', '38.png', '4', '一、活动背景 春去夏来，万物复苏。四月，是一个浪漫如梦，温情四溢的月份。阳春四月，草长莺飞间，冬天的寒意慢慢褪尽，春天带着绿色的气息向我们走来，吹绿了地上的小草，也吹动了意气风发的大学生的热情。时代发展日新月异，歌曲的形式、手法以及所表达的思想也更加多元化，各大高校校园广场舞接踵而至。音乐的旋律也穿梭在大学生们的脑海中。逐渐悦动起来，随处都散发着青春的气息。它不仅丰富了疫情之下的校园生活，更承载着我们数不尽的情感。 二、活动目的 为丰富我院大学生的业余文化生活，提高学生综合素质能力，发扬学生青春个性，更是给那些热爱唱歌、热爱文娱活动的同学一个展示自我的舞台，给大学生一个发挥特长、自我锻炼的机会，同时挖掘自身潜质，培养他们勇于表现自己的能力，增强自信，发掘更多唱歌人才。 三、活动主题 青春战“疫”、“音”你不凡校园十佳歌手大赛 四、活动内容 1、参赛对象：全校学生 2、活动时间 2022年4月17日-25日（初赛） 2022年4月29日（复赛） 2022年5月7日（决赛） 3、活动地点 线上（初赛） 足球场（复赛、决赛） 五、活动内容 （一）、初赛 1、投稿时间 2022年4月17日-19日20：30 2、比赛形式 初赛以线上的形式进行，参赛选手需要录制1-2分钟的清唱视频，视频的内容为选手简短的自我介绍和歌曲演唱，初选视频不可有音乐或者歌曲伴奏，选手要在安静的坏境下录制视频，视频内容嘈杂或者不按要求录制者，不得参与初赛的评选； 选手可以自行组合合唱也可以单人独唱；选手需将拍好的视频及时的发送至科院团委学生会官方QQ邮箱（2684689430@qq.com），视频命名为姓名+歌曲名称，格式为MP4格式。同时，参赛人员需将拍摄的视频上传至投票小程序，经观众的投票，比赛结束后，投票数最多的选手可获得最佳人气奖。 参赛人员不得作假，一经发现取消比赛资格。 3、评选时间 4月20日-4月25日 4、评选工作 由工作人员初筛选出40-50名选手，将筛选出来的视频压缩打包发送给评委老师，评委老师最终筛选出25-30名选手进入复赛。 （二）、复赛 1、比赛时间：2022年4月29日19：00 2、比赛地点：足球场 （三）决赛 1、比赛时间:2022年5月7日19：00 2、比赛地点：足球场', '365', '500', '2022-04-18 12:47:04', '2022-04-19 12:47:08', '0', '线下-足球场');
INSERT INTO `active` VALUES ('21', '以I之笔，SHOW出青春', '2022-04-11 16:28:20', '2022-04-26 16:28:28', '896', '10.png', '4', '1、活动报名：所有参加活动的人员在到梦空间进行活动报名并加入相关的活动交流QQ群。群号：756545903 2、作品提交：所有参与人员的作品都通过QQ邮箱发送到I SHOW舞团的官Q邮箱（523308171@qq.com），并在邮件中留下本人的姓名、班级、QQ与电话号码。 3、作品评比：作品的评比将于截稿期后进行，评选工作由宣传部的部长们与主席团成员共同进行。 4、奖项设置与颁发：一等奖一名奖金100 荣誉 二等奖一名奖金50 荣誉 三等奖一名奖金30 荣誉 奖品的发放将于活动后期由相关负责人联系获奖设计者进行颁发。', '1', '600', '2022-04-18 16:30:11', '2022-04-30 16:30:16', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('22', '计算机保养和软件推荐讲座', '2022-04-21 16:37:29', '2022-04-28 16:37:35', '1542', '11.png', '3', '计算机保养和软件推荐活动分3个部分进行。 1. 第一部分 为同学讲解如何保养电脑，让电脑的运行寿命更长，运行速度更快。 2. 第二部分 为同学推荐一些好软件，如：去除电脑广告的火绒杀毒软件，卸载流氓软件的geek等。让同学们远离广告和流氓软件骚扰，更加舒适地使用和维护电脑。 3.第三部分 疑问解答，对同学们不够清楚的部分进行解答。', '0', '500', '2022-04-21 16:38:20', '2022-04-29 16:38:25', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('23', '计算机学院 机器学习及计算生物学介绍讲座', '2022-05-06 16:39:19', '2022-05-08 16:39:23', '2349', '12.png', '5', '众所周知人工智能已经进入了我们生活的方方面面，小到手机中的人脸识别、翻译软件，大到国防、航天领域都离不开人工智能技术。同学们肯定对于这些人工智能技术肯定是即熟悉又陌生。所以我们想要凭借这个机会向大家介绍关于人工智能的一些知识。', '3', '500', '2022-04-22 16:42:17', '2022-05-01 16:42:25', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('24', '楚韵汉服社“以诗会友”', '2022-05-20 16:43:24', '2022-05-26 16:43:28', '2503', '13.png', '4', '自古以来我们都有三月三无论男女老少都聚集在一起，河边祓禊聚会，朋友相约户外踏青的活动。然而随着时间的推移至今人们却似乎忘了上巳节浪漫的传统习俗。 楚韵汉服社举办此次活动，希望能以生动有趣的活动， 唤回华夏传统记忆，使参与者身临其境,让更多的人了解中国传统的上巳节，弘扬民族风俗文化，彰显两汉文化特色.', '2', '400', '2022-04-28 16:44:36', '2022-05-12 16:44:41', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('25', '校团委组织部九月份团日活动', '2022-05-01 16:46:42', '2022-05-06 16:46:35', '461', '14.png', '2', '在庆祝中国共产党成立100周年大会上，习近平总书记以豪迈的自信、激昂的壮志，庄严宣告实现了第一个百年奋斗目标、全面建成了小康社会，郑重宣示坚持和发展新时代中国特色社会主义、向全面建成社会主义现代化强国的第二个百年奋斗目标迈进的坚定决心。2021年9月18日是全国第21个全民国防教育日,恰逢“九一八”事变爆发90周年纪念日。为学习贯彻习近平总书记“七一”重要讲话精神，弘扬爱国主义精神,推动国防教育深入普及，校团委特此举办“学习贯彻习近平总书记‘七一’重要讲话精神——全民国防，强国有我”主题团日活动。', '1', '300', '2022-04-26 16:46:58', '2022-04-30 16:47:06', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('26', '校朋辈互助联盟“踏青好时节 风景随手拍”', '2022-04-18 16:49:00', '2022-04-29 16:48:56', '1258', '15.png', '4', '随着清明节的到来春回大地，精神气爽，一年的劳作从此开始，春耕春种，开始忙碌。祭拜祖先，追忆先人，也在同时进行。中华民族的祭祖活动往往在郊外进行，人们把扫墓和郊游结合起来即陶冶情操，又促进了身心的健康。   而此时工大校园以及周边到处也都焕发着生机，美丽的风景随处可见。工大的学子们也已经在学校度过了1个月之久，又再次习惯了学校的生活。借此机会希望同学们融入自然，多看蓝天白云，闻百花香，听燕子呢喃，畅游在湘江两岸,尽情享受自然的美丽，从而愉悦身心，缓解一下日常紧凑的学习生活节奏。', '2', '600', '2022-04-27 16:49:09', '2022-04-30 16:49:14', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('27', '计算机学院卫星导航系统建设与应用讲座', '2022-04-19 16:50:35', '2022-04-29 16:50:40', '698', '16.png', '5', '“专家进校园”活动作为“湖南大学生智能导航科技创新大赛”的重要活动之一，旨在通过传播卫星导航前沿知识，培养当代青年学生对北斗卫星导航事业的兴趣，普及北斗卫星导航知识，展示北斗系统最新进展和成果，培养青少年的科学精神和探究能力，并为青年学生提供专家指导，帮助其实现科技创新，进而为北斗导航事业发现和培养新的人才。', '125', '500', '2022-04-18 16:51:22', '2022-04-29 16:52:02', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('28', '湖南工业大学2020迎新晚会', '2022-01-01 16:53:16', '2022-04-02 16:53:35', '261', '17.png', '4', '金秋九月，秋风飒爽，梦想启航；我校2020级已完成报道，各地学子来到湖南工大开启美好的大学时光；别具一格的校园环境、各具特色的欢迎活动不断在校园内上演；由湖南工业大学主办，共青团湖南工业大学委员会承办的以“青春远航•乘风破浪”为主题的迎新晚会将于9月28日晚举办，旨在为更好的服务20级新生、帮助新生尽快适应、融入大学生活。', '2', '500', '2022-04-18 16:54:25', '2022-04-30 16:54:27', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('29', '校青志联2020年全国大学生预防艾滋病知识竞赛', '2022-05-12 16:55:35', '2022-05-08 16:55:00', '644', '18.png', '5', '宣传艾滋病知识，了解大学生艾滋病知识普及情况。旨在普及宣传防治艾滋病相关知识，提高大学生抵御艾滋病的能力，为解决我国严峻的艾滋病流行形势做出应有的贡献。', '3', '600', '2022-04-28 16:56:17', '2022-05-03 16:56:22', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('30', '电气学院创客协会《嵌入式物联技术发展与应用》讲座', '2022-04-18 16:57:47', '2022-04-28 16:57:50', '353', '19.png', '5', 'IT技术飞速发展，互联网时代已经进入了“物联网”时代 。为了让同学们了解和掌握更多的专业知识技能，同时为了拓宽我们工大热爱嵌入式系统开发的学子们的视野，创客协会特地邀请了企业工程师给感兴趣的同学们普及讲解嵌入式有关的知识 。讲座将对参加活动的同学进行单片机技术教学，使同学们对单片机有更加深入的了解 。', '57', '500', '2022-04-06 16:59:09', '2022-04-30 16:59:13', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('32', '校团委实践部第三届“我是答题王”知识竞赛大学生专场赛', '2022-04-18 17:04:44', '2022-04-18 17:02:34', '45', '21.png', '5', '为深入贯彻习近平总书记关于加强禁毒工作系列重要批示指示精神，引导广大高校学子学习了解毒品知识、树立健康向上的生活理念，共青团湖南工业大学团委实践部决定举办第三届“我是答题王”知识竞赛大学生专场赛。', '88', '500', '2022-04-19 17:04:18', '2022-04-29 17:04:22', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('33', '爱心社 迷彩不迷路-2020届军训套装回收', '2022-04-04 17:06:01', '2022-04-19 17:06:04', '458', '22.png', '3', '嘹亮的口号，飒爽的英姿，军训是你们步入大学生活的阶梯，给了自己一个全新的面貌去迎接新的青春。 然而，军训寥寥数日，当一切结束，唯回忆永存，也请不要让曾陪伴你的军训服被尘土掩盖。 请将你闲置的军训服交给我们，让我们一起，为不曾谋面的孩子送上温暖与爱，也为社会承担一份责任。', '1', '300', '2022-04-18 17:08:57', '2022-04-28 17:09:01', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('34', '音乐学院团学会宣传部音乐门类公选课问卷调查活动2.0', '2022-05-06 17:18:46', '2022-05-08 17:13:31', '487', '23.png', '2', '2020级新一代大学生都是伴随新生事物成长的一代，音乐学院教师为了更好地开展符合“00”后大学生的音乐类课程，特此开展问卷调查，通过此调查是为更透彻的了解“00”后大学生他们对音乐门类的兴趣所在，以便更好的开展教学活动。音乐中各门类课程因为本身所具有的美育功能而成为高校实现素质教育一项重要内容，也是培养创新型人才高素质人才的有效途径之一。音乐美育在发展大学生个性、完善个人中具有积极重要的作用。中共中央、国务院发布《关于进一步加强和改进大学生思想政治教育的意见》文件，大学生美育教育至关重要。因此能够开设多种类型音乐门类校级公选课，也符合培养综合性高素质大学生的目标。', '2', '2000', '2022-04-18 17:18:24', '2022-05-04 17:18:28', '0', '线上-学习通APP');
INSERT INTO `active` VALUES ('35', '科技学院“读懂中国”主题教育活动', '2022-05-08 21:30:17', '2022-05-12 21:30:23', '568', '39.png', '2', '该活动主要以征文、微视频、舞台剧（短视频）等形式进行展示和传播 （一）征文： 文体要求：记叙文； 语言要求：通顺流畅、表达清晰、可读性强； 字数要求：不超过2000字。 （二）微视频： 形态风格：专题片、微记录； 视频格式：MP4不低于15M码流、1920×1080无损高清格式16：9； 节目风格：用艺术手法拍摄制作校园专题片、微纪录等，画面构图完整 清晰、镜头有设计感、拍摄手法丰富，故事内容真实有效； 时间要求：5分钟整； 字幕要求：对白、旁白和解说等均须加配中文字幕。用字准确无误、不 使用繁体字、异体字、错别字；字幕位置居中，字体字号为黑体60号，字边要加阴影；字幕应与画面有良好的同步性； 资料运用：片中一旦涉及到非本校拍摄、不属于拍摄团队创作的视频素 材，一律要在画面右上角注明“资料”字样。“资料”字体字号为黑体65号，字边要加阴影。 （三）舞台剧： 视频要求：低于10分钟（发动高校社团资源，将“五老”的采访素材改 编成舞台剧，通过切换台进行多机位录制，剪辑成视频参与征集）； 视频格式：MP4不低于15M码流、1920×1080无损高清16：9； 节目风格：用艺术手法拍摄、制作校园舞台剧，画面构图完整。', '2', '500', '2022-04-22 21:31:46', '2022-05-04 21:31:51', '0', '线上-腾讯会议');
INSERT INTO `active` VALUES ('36', '土木工程学院第三十一届团学会学生会文体部土木杯篮球赛', '2022-04-14 21:36:05', '2022-04-20 21:36:15', '478', '40.png', '1', '为了增强同学身体素质，进一步推动体育活动的开展，带动体育活动的风气，增强班级的凝聚力，给同学们展示自我的舞台；为了营造一个积极、健康、热烈、活泼、朝气蓬勃的校园环境，也为全面落实党的教育方针和推动学校学生篮球运动的开展，丰富校园文化活动，互相学习，交流经验，达到增强学生体质和提高我院学生的篮球运动水平', '136', '200', '2022-04-13 21:37:30', '2022-04-15 21:37:34', '0', '线下-篮球场');
INSERT INTO `active` VALUES ('37', '经济与贸易学院二课部“春满花寨，向阳而生”活动', '2022-05-08 21:41:19', '2022-05-13 21:41:28', '1899', '41.png', '1', '春天是四季绮丽瑰秀之天，春天到了，工大再一次焕发出别样的生机与魅力。本次活动由经济与贸易学院第二课堂管理部举办，采用线上活动的方式进行，再有工作人员整理，最后进行后台补签，签到距离统一为50m。 活动内容：活动参与者需要在QQ空间发布说说并艾特官方QQ2872634702，说说内容为：一张春景图并配文构图技巧以及80字以上对春天的赞美。', '3', '400', '2022-04-28 21:42:49', '2022-05-07 21:42:57', '0', '线上-腾讯会议');
